import React from 'react';

const Pourquoi = () => (
  <>
    <h2>Pourquoi Oniti</h2>
      <p>Le large panel de compétence de l'agence (logiciel, site et app web, audit et conseil) sont riches de promesses pour un stagiaire comme moi   </p>
        Je n'ai pas encore assez de recul pour réussir à
         juger de la technicité des projets présentés par les différentes agences.
          En revanche les valeurs d'utopies de civilisation et de dégout profond des
           excès de notre monde me parle profondéments.   </>
);

export default Pourquoi;
